import "./Home.css";

import Hero from "./Hero/Hero";
import CategoryCards from "../../CategoryCard/CategoryCard";

const Home = ({ products }) => {
  return (
    <section className="home">
      <Hero />

      <ul className="category-cards">
        {products.map((card) => (
          <CategoryCards
            key={card.id}
            card={card}
            onCardClick={onCardClick}
            onCardLike={onCardLike}
            onCardDelete={onCardDelete}
          />
        ))}

        {products.map((card) => {
          <CategoryCards key={card.id} />;
        })}
      </ul>
    </section>
  );
};
export default Home;
